$.fn.highlightTxt = function (keyword) {
  return this.each(function () {
    let $firstHtml = $(this).data('html'),
      $html = $(this).html();
    if (!$firstHtml) {
      $firstHtml = $(this).html();
      $(this).data('html', $html);
    }
    if (keyword != '') {
      if ($firstHtml.indexOf(keyword) >= 0) {
        $html = $firstHtml.split(keyword).join('<em class="t-keyword">' + keyword + '</em>');
      } else {
        $html = $firstHtml;
      }
    } else {
      $html = $firstHtml;
    }
    $(this).html($html);
  });
};

